// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

/**
 * @title SecureCrowdfund
 * @dev A gas-efficient crowdfunding contract with goal tracking and secure withdrawals
 */
contract SecureCrowdfund {
    address payable public immutable owner;
    uint256 public immutable fundingGoal;
    uint256 public immutable deadline;
    uint256 public totalRaised;
    bool public fundsWithdrawn;
    
    mapping(address => uint256) public contributions;
    
    event ContributionReceived(address indexed donor, uint256 amount);
    event FundsWithdrawn(uint256 amount);
    event RefundClaimed(address indexed donor, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not contract owner");
        _;
    }

    /**
     * @dev Initialize contract with campaign parameters
     * @param _fundingGoal Funding goal in wei
     * @param _duration Campaign duration in seconds
     */
    constructor(uint256 _fundingGoal, uint256 _duration) {
        require(_fundingGoal > 0, "Goal must be greater than zero");
        require(_duration > 0, "Duration must be greater than zero");
        
        owner = payable(msg.sender);
        fundingGoal = _fundingGoal;
        deadline = block.timestamp + _duration;
    }

    /**
     * @dev Accept contributions
     */
    function contribute() external payable {
        require(block.timestamp < deadline, "Campaign has ended");
        require(msg.value > 0, "Contribution must be greater than zero");
        
        contributions[msg.sender] += msg.value;
        totalRaised += msg.value;
        
        emit ContributionReceived(msg.sender, msg.value);
    }

    /**
     * @dev Withdraw funds if goal is met (owner only)
     */
    function withdrawFunds() external onlyOwner {
        require(block.timestamp >= deadline, "Campaign not ended");
        require(totalRaised >= fundingGoal, "Funding goal not met");
        require(!fundsWithdrawn, "Funds already withdrawn");
        
        fundsWithdrawn = true;
        uint256 amount = totalRaised;
        totalRaised = 0; // Prevent reentrancy
        
        owner.transfer(amount);
        emit FundsWithdrawn(amount);
    }

    /**
     * @dev Claim refund if campaign failed
     */
    function claimRefund() external {
        require(block.timestamp >= deadline, "Campaign not ended");
        require(totalRaised < fundingGoal, "Funding goal was met");
        
        uint256 amount = contributions[msg.sender];
        require(amount > 0, "No contribution to refund");
        
        contributions[msg.sender] = 0; // Prevent reentrancy
        payable(msg.sender).transfer(amount);
        
        emit RefundClaimed(msg.sender, amount);
    }

    /**
     * @dev Get remaining time for the campaign
     */
    function getRemainingTime() external view returns (uint256) {
        return block.timestamp < deadline ? deadline - block.timestamp : 0;
    }
}

